unsigned int unbuffer_data_codepoint(int offset) {
	return unbuffer_unicode_data[offset];
};
int unbuffer_data_iscanonical(int offset) {
	return ((unbuffer_unicode_data[offset+1] & 0x0000FF00) >> 8);
};
int unbuffer_data_class(int offset) {
	return (unbuffer_unicode_data[offset+1] >> 16);
};
int unbuffer_data_decompositionlen(int offset) {
	return (unbuffer_unicode_data[offset+1] & 0x000000FF);
};
unsigned int * unbuffer_data_decomposition(int offset) {
	int length = unbuffer_data_decompositionlen(offset);
	if(length > 0) {
		return &(unbuffer_unicode_data[offset+2]);
	}
	return NULL;
};

void unbuffer_data_print(unbuffer_data * data) {
	
	fprintf(stdout,"codepoint : %X class : %u canonical : %u length : %d decomposition : ",data->codepoint,data->class,data->canonical,data->decomposition_len);
	
	int index; 
	for(index = 0; index < data->decomposition_len; index++) {
		fprintf(stdout,"[%X]",data->decomposition[index]);
	}
	fprintf(stdout,"\n");
}


int unbuffer_data_write(unbuffer_data * data, unsigned int * dst) {

	int count = 0;	// Total written ints;
	int d_count;
	
	*dst = data->codepoint;
	dst++;
	count++;
	
	int flag = 0;
	d_count = data->decomposition_len;
	flag = (data->class << 16) | (data->canonical << 8) | d_count;
	*dst = flag;
	dst++;
	count++;
	
	int index;
	for(index = 0; index < data->decomposition_len; index++) {
		*dst = data->decomposition[index];
		dst++;
	}
	count+=d_count;

	return count;
}

int unbuffer_data_comparedecomposition2(unsigned int * d0, int d0_len, unsigned int * d1, int d1_len) {
	
	int min;
	int diff;
	int index;
	
	min = d0_len < d1_len ? d0_len : d1_len;
	
	index = 0;
	while(index < min) {
		diff = (d0[index] - d1[index]);
		if(diff!=0) {
			return diff;
		}
		index++;
	}
	
	if(d0_len > d1_len) {
		return d0[index];
	} else if (d0_len < d1_len) {
		return -(d1[index]);
	}
	
	return 0;
}

int unbuffer_data_comparedecomposition(unbuffer_data * d0, unsigned int * deco, int deco_len) {
	
	int min;
    int index;
    int diff;
    
    if(d0->decomposition_len != deco_len) {
        
        min = d0->decomposition_len < deco_len ? d0->decomposition_len : deco_len;
        
        index = 0;
        while(index < min) {
            if((diff = (d0->decomposition[index] - deco[index]))!=0) {
                return diff;
            }
            index++;
        }
        
        if(d0->decomposition_len > deco_len) {
            return d0->decomposition[min];
        } else if (d0->decomposition_len < deco_len) {
            return -(deco[min]);
        }
        
    } else {
    
        index = 0;
        while(index < deco_len) {
            if((diff = (d0->decomposition[index] - deco[index]))!=0) {
                return diff;
            }
            index++;
        }
        return 0;
    }
    
    return 0;
}


/**
	Check and return the difference between the first and the second data. Return > 0 if the first
	is larger, < 0 if the second is larger, 0 if they are the same.
*/
int unbuffer_data_compare(unbuffer_data * d0, unbuffer_data * d1) {
	
	int min;
	min = d0->decomposition_len < d1->decomposition_len ? d0->decomposition_len : d1->decomposition_len;
	
	int index;
	index = 0;
	
	int diff;
	while(index < min) {
		diff = (d0->decomposition[index] - d1->decomposition[index]);
		if(diff!=0) {
			return diff;
		}
		index++;
	}
	
	if(d0->decomposition_len > d1->decomposition_len) {
		return d0->decomposition[index];
	} else if (d0->decomposition_len < d1->decomposition_len) {
		return -(d1->decomposition[index]);
	}
	
	return 0;
}

void unbuffer_data_init(unbuffer_data * data, unsigned int * src) {
	
	unsigned int codepoint = *src;
	src++;
	
	unsigned int flags = *src;
	unsigned char class = (flags >> 16);
	unsigned char canonical = (flags & 0x0000FF00) >> 8;
	unsigned char count = (flags & 0x000000FF);
	src++;
	
	unbuffer_data_init_p(data, codepoint, class, canonical, count, src);
}

void unbuffer_data_init_p(unbuffer_data * data,		// Struct to be initialized
	unsigned int codepoint, 					// Unicode value
	unsigned char class, 					// Class
	unsigned char canonical, 				// Canonical or not
	unsigned char decomposition_len, 		// Decomposition values count (0 = NONE)
	unsigned int * decomposition_values) 	// Decomposition values array
	{
	
	if(!data)
		return;
	
	data->codepoint = codepoint;
	data->class = class;
	data->canonical = canonical;
	data->decomposition_len = decomposition_len;
	
	if(data->decomposition)
		free(data->decomposition);
		
	unsigned int * tmp = malloc(decomposition_len * sizeof(unsigned int));
	memcpy(tmp,decomposition_values,decomposition_len * sizeof(unsigned int));
	data->decomposition = tmp;
}

void unbuffer_data_destroy(unbuffer_data * data) 
{
	if(!data)
		return;
		
	if(data->decomposition)
		free(data->decomposition), data->decomposition = NULL;	
}

int unbuffer_data_size(unbuffer_data * data) {
	return 2 + data->decomposition_len;
}

static inline void unbuffer_data_swappos(int * array, int p0, int p1) {

	int tmp = array[p0];

	array[p0] = array[p1];
	array[p1] = tmp;
}

void unbuffer_data_sort(int * positions, int positions_len, unsigned int * data) {

	unbuffer_data data0 = {0,0,NULL,0,1}; 
	unbuffer_data data1 = {0,0,NULL,0,1};
	
	int cur_pos;
	int min_pos;
	int i;
	
	for(cur_pos = 0; cur_pos < positions_len-1; cur_pos++) {
	
		min_pos = cur_pos;
		unbuffer_data_init(&data0,data + positions[min_pos]);
			
		for(i = cur_pos+1; i < positions_len; i++) {
		
			unbuffer_data_init(&data1,data + positions[i]);
			
			if(unbuffer_data_compare(&data1, &data0) < 0) {
				min_pos = i;
				unbuffer_data_init(&data0,data+positions[min_pos]);
			}
		}
	
		// Swapping positions value.
		if(min_pos!=cur_pos) {
			// fprintf(stdout,"Swapping %d <-> %d\n",min_pos,cur_pos);
			unbuffer_data_swappos(positions,min_pos,cur_pos);
		}
	}
    
    unbuffer_data_destroy(&data0);
    unbuffer_data_destroy(&data1);
}

