int unbuffer_data_lookupdata(unbuffer_data * decomposition, int * positions, unsigned int * data, int min, int max) {
	
	unbuffer_data lookedup = {0,0,NULL,0,1};
	int mid;
	int difference;
	
	if(min > max) 
		return -1;
	
	mid = min + (max - min)/2;
	
	unbuffer_data_init(&lookedup, data + (positions[mid]));
	
	difference = unbuffer_data_compare(decomposition,&lookedup);
    
    unbuffer_data_destroy(&lookedup);
	
	if(difference == 0) { // No difference, we have found it!
		
		return mid;
		
	} else if (difference > 0)  { // Codepoint is greater.
		
		return unbuffer_data_lookupdata(decomposition, positions, data, (mid + 1), max);
		
	} else { // Codepoint si smaller.
		
		return unbuffer_data_lookupdata(decomposition, positions, data, min, (mid - 1));
	}
}



