int _unbuffer_data_lookupcompatibility(unsigned int * deco, int deco_len, int min, int max) {
	
	unbuffer_data lookedup = {0,0,NULL,0,1};
	int mid;
	int difference;
	
	//unsigned int * lookedup_deco;
	//int lookedup_deco_len;
	
	if(min > max) 
		return -1;
	
	mid = min + (max - min)/2;
	
	unbuffer_data_init(&lookedup, unbuffer_unicode_data + (unbuffer_compatibility_offsets[mid]));
	
	difference = unbuffer_data_comparedecomposition(&lookedup,deco,deco_len);
    
    unbuffer_data_destroy(&lookedup);
	
	if(difference == 0) { // No difference, we have found it!
		
		return mid;
		
	} else if (difference > 0)  { // Data is greater.
		
		return _unbuffer_data_lookupcompatibility(deco, deco_len, min, (mid - 1));
		
	} else { // Lookedup is smaller.
		
		return _unbuffer_data_lookupcompatibility(deco, deco_len, (mid + 1), max);
	}
}


int _unbuffer_data_lookupdecomposition(unsigned int * deco, int deco_len, int min, int max) {
	
    unbuffer_data lookedup = {0,0,NULL,0,1};
	int mid;
	int difference;
	
	//unsigned int * lookedup_deco;
	//int lookedup_deco_len;
	
	if(min > max) 
		return -1;
	
	mid = min + (max - min)/2;
	
	unbuffer_data_init(&lookedup, unbuffer_unicode_data + (unbuffer_decomposition_offsets[mid]));
	
	difference = unbuffer_data_comparedecomposition(&lookedup,deco,deco_len);
    
    unbuffer_data_destroy(&lookedup);
	
	if(difference == 0) { // No difference, we have found it.
        
		return mid;
		
	} else if (difference > 0)  { // Data is greater.
		
		return _unbuffer_data_lookupdecomposition(deco, deco_len, min, (mid - 1));
		
	} else { // Lookedup is smaller.
		
		return _unbuffer_data_lookupdecomposition(deco, deco_len, (mid + 1), max);
	}
}

int _unbuffer_data_lookupcodepoint(unsigned int codepoint, int min, int max) {

	int mid;
	unsigned int lookedup;
	int difference;
	
	if(min > max) 
		return -1;
	
	mid = min + (max - min)/2;
	
	lookedup = unbuffer_unicode_data[unbuffer_codepoint_offsets[mid]];
	
	difference = codepoint - lookedup;
	
	if(difference == 0) { // No difference, we have found it!
		
		return mid;
		
	} else if (difference > 0)  { // Codepoint is greater.
		
		return _unbuffer_data_lookupcodepoint(codepoint, (mid + 1), max);
		
	} else { // Codepoint si smaller.
		
		return _unbuffer_data_lookupcodepoint(codepoint, min, (mid - 1));
	}
}


